import React from 'react';
import './ViewWorkout.css'; // Ensure to use the correct CSS file that contains styles for the classes used below

function ViewWorkout() {
    const workout = {
        title: "My Workout",
        exercises: [
            {
                name: "Bench Press",
                sets: [
                    { reps: 10, weight: 100 },
                    { reps: 8, weight: 120 }
                ]
            },
            {
                name: "Squat",
                sets: [
                    { reps: 8, weight: 150 },
                    { reps: 6, weight: 170 }
                ]
            }
        ]
    };

    return (
        <div className="display-container">
            <h1 className="workout-title">{workout.title}</h1>
            {workout.exercises.map((exercise, index) => (
                <div key={index} className="exercise-wrapper">
                    <div className="exercise-content">
                        <h2 className="exercise-header">{exercise.name}</h2>
                        <table className="table">
                            <thead>
                                <tr>
                                    <th>Set</th>
                                    <th>Reps</th>
                                    <th>Weight</th>
                                </tr>
                            </thead>
                            <tbody>
                                {exercise.sets.map((set, idx) => (
                                    <tr key={idx}>
                                        <td>Set {idx + 1}</td>
                                        <td>{set.reps}</td>
                                        <td>{set.weight}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            ))}
        </div>
    );
}

export default ViewWorkout;
